import React from "react";

function Body() {
  return (
    <div className="body">
      Venture across the grim lands of Sorrowfen. Delve into dark, foe-infested
      dungeons. Outwit your opponents and reign champion of the land. Little
      Dungeon Crawlers is a tabletop action RPG board game that takes the
      fantasy of dungeon crawlers and loot grinder games and compacts it both in
      size and in play time into a physical tabletop game.
    </div>
  );
}

export default Body;
